import { Route, NavLink, Switch } from 'react-router-dom';
import MoviesPage from './pages/MoviesPage';

export default function App() {
  return (
    <>
      <ul>
        <li>
          <NavLink>to ='/'</NavLink>
        </li>
      </ul>

      <Switch>
        <Route path="/" component={MoviesPage}></Route>
      </Switch>
    </>
  );
}

